import React, {useState, useEffect} from 'react';
import axios from 'axios';
import "./Home.css";

const Home = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get("http://localhost:3006/");
      console.log(response.data.books);
      setData(response.data.books);
    };
    fetchData();
  }, []);
  return (
    <>
      <h1>this is the homepage</h1>
      <h2>{data && data.name} </h2>
      <Homepage {...homepageData} />;
    </>
  );
};

function Homepage(props) {
  const {
    overlapGroup8,
    logo,
    signInToGetLearningOr1,
    signUp,
    signInToGetLearningOr2,
    username,
    inputType1,
    inputPlaceholder1,
    password,
    inputType2,
    inputPlaceholder2,
    keepMeLoggedIn,
    signIn,
    uiLoginPageDesktopPrototype11,
    signInWithGmail,
    homepage_Cat,
  } = props;

  return (
    <div className="container-center-horizontal">
      <div className="loginscreen">
        <div className="overlap-group8" style={{ backgroundImage: `url(${overlapGroup8})` }}>
          <div className="group-container">
            <div className="overlap-group7poppins-normal-white-28px">
              <img className="logo" src={logo} />
              <div className="sign-in-to-get-learning-orvalign-text-middle">
                {signInToGetLearningOr1}
              </div>
              <div className="sign-upvalign-text-middle">
                {signUp}
              </div>
            </div>
            <div className="overlap-group6">
              <h1 className="titlevalign-text-middlepoppins-normal-stack-30px">
                {signInToGetLearningOr2}
              </h1>
              <div className="usernamepoppins-normal-white-25px">
                {username}
              </div>
              <div className="overlap-group2">
                <textarea
                  className="namepoppins-normal-quick-silver-25px"
                  name="name"
                  placeholder={inputPlaceholder1}
                  type={inputType1}
                  required
                ></textarea>
              </div>
            </div>
            <div className="overlap-group5">
              <div className="passwordpoppins-normal-white-25px">
                {password}
              </div>
              <div className="overlap-group3">
                <textarea
                  className="password-1poppins-normal-quick-silver-25px"
                  name="password"
                  placeholder={inputPlaceholder2}
                  type={inputType2}
                  required
                ></textarea>
              </div>
            </div>
            <div className="group-3">
              <div className="rectangle-4"></div>
              <div className="keep-me-logged-inpoppins-normal-white-22px">
                {keepMeLoggedIn}
              </div>
            </div>
            <div className="overlap-group1">
              <div className="rectangle-5"></div>
              <div className="sign-invalign-text-middlepoppins-normal-white-30px">
                {signIn}
              </div>
            </div>
            <div className="overlap-group">
              <img className="ui-login-page-desktop-prototype-1-1" src={uiLoginPageDesktopPrototype11} />
              <div className="sign-in-with-gmailvalign-text-middlepoppins-normal-white-30px">
                {signInWithGmail}
              </div>
            </div>
          </div>
          <img className="homepage_cat" src={homepage_Cat} />
        </div>
      </div>
    </div>
  );
}

const homepageData = {
  overlapGroup8: "homepage-background.png",
  logo: "logo.png",
  signInToGetLearningOr1: "Sign in to get learning or",
  signUp: "Sign Up",
  signInToGetLearningOr2: "Sign in to get learning or",
  username: "Username",
  inputType1: "text",
  inputPlaceholder1: "Name",
  password: "Password",
  inputType2: "text",
  inputPlaceholder2: "Password",
  keepMeLoggedIn: "Keep me logged in",
  signIn: "Sign In",
  uiLoginPageDesktopPrototype11: "ui-page-desktop-prototype-1-1.png",
  signInWithGmail: "Sign In With Gmail",
  homepage_Cat: "homepage-cat.png",
};

export default Home;
